INSERT INTO `grb_help` VALUES (1,'grb_catalog_main_help','Welcome to grbcatalog.org','You can use grbcatalog.org to perform basic data analysis and plotting tasks on available GRB measurements.  Our aim is to eventually add most of publish GRB measurements into our database.\r\n\r\nThe main page of the grbcatalog.org allows you to select your GRB sample. First you need to select what GRB measurements that you are interested in. You can do this by clicking check boxes next to various GRB measurements.  Then you can decide whether you need to make any cuts on your GRB sample.  First specify the number of cuts you need to do in the \"Number of Cuts\" text box and click \"Add Cuts\" button next to it. This will refresh the page and show you set of drop-down boxes corresponds to various cuts.  From the drop-down box, you can select the measurement that you need to cut on and specify the bounds. Repeat this for all cuts. Then click \"Select the GRB Sample\" button. This will show all the GRBs that satisfy your criteria as a table at the lower part of the page. \r\n\r\nOnce you have selected your sample then you can make histogram of various measurements by clicking the \"Histogram\" button at the top of each column. You can also make correlation plots on the selected sample by clicking \"Make Correlation Plots on the Selected GRB Sample\" button next to the \"Help\" button. \r\n'),(2,'grb_catalog_histo_help','GRB Catalog Histogram','This page displays a histogram of a GRB measurement for the sample you selected in the main grbcatalog.org page. Using various options at the top of the page, you can modify the histogram according to your needs.'),(3,'grb_catalog_corr_help','GRB Catalog Correlation Plots','This page displays a correlation plot of two GRB measurements for the sample that you selected in the main grbcatalog.org page. Using various options at the top of the page, you can change the two measurements that you are interested in and the click on the \"Plot\" button to see the results. There are other options at the top of the page which allows you to modify the plot according to your needs.');
/*!40000 ALTER TABLE `grb_help` ENABLE KEYS */;
UNLOCK TABLES;

